    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        /* Hiding the scrollbar */
        html {
            scrollbar-width: none; /* Firefox */
            -ms-overflow-style: none; /* Internet Explorer 10+ */
        }

        html::-webkit-scrollbar {
            width: 0;
            height: 0;
            display: none; /* Chrome, Safari, Opera */
        }

        body {
            font-family: 'Inter', -apple-system, BlinkMacSystemFont, 'Segoe UI', sans-serif;
            background: #f8f9fa;
            min-height: 100vh;
            overflow-x: hidden;
            scrollbar-width: none;
            -ms-overflow-style: none;
            position: relative;
        }

        body::-webkit-scrollbar {
            display: none;
        }

        .top-bar {
            position: fixed;
            top: 0;
            left: 0;
            right: 0;
            display: flex;
            justify-content: space-between;
            align-items: center;
            padding: 20px 30px;
            z-index: 1000;
            font-family: 'Inter', sans-serif;
            font-size: 14px;
            font-weight: 500;
            color: #1a1a1a;
        }

        .timezone {
            letter-spacing: 1px;
        }

        .cant-see {
            letter-spacing: 0.5px;
            cursor: pointer;
            transition: all 0.2s ease;
            padding: 4px 8px;
            border-radius: 4px;
        }

        .cant-see:hover {
            background: rgba(26, 26, 26, 0.1);
            transform: scale(1.05);
        }

        .cant-see:active {
            transform: scale(0.95);
        }

        .live-time {
            font-weight: 600;
            letter-spacing: 0.5px;
        }

        .container {
            width: 100%;
            max-width: 100vw;
            padding: 20px;
            padding-top: 80px;
            display: flex;
            justify-content: center;
            align-items: flex-start;
            min-height: 100vh;
        }

        .resume {
            width: 100%;
            max-width: 900px;
            height: auto;
            border-radius: 12px;
            box-shadow: 0 20px 60px rgba(0, 0, 0, 0.15), 
                        0 8px 25px rgba(0, 0, 0, 0.1);
            margin: 0 auto;
            display: block;
            background: white;
            animation: fadeIn 0.8s ease-in-out;
            position: relative;
        }

        .resume svg {
            width: 100%;
            height: auto;
            display: block;
            border-radius: 12px;
        }

        .resume img {
            width: 100%;
            height: auto;
            display: none;
            border-radius: 12px;
            image-rendering: -webkit-optimize-contrast;
            image-rendering: crisp-edges;
        }

        @keyframes fadeIn {
            from {
                opacity: 0;
                transform: translateY(30px);
            }
            to {
                opacity: 1;
                transform: translateY(0);
            }
        }

        @keyframes switchContent {
            0% {
                opacity: 1;
                transform: scale(1);
            }
            50% {
                opacity: 0;
                transform: scale(0.95);
            }
            100% {
                opacity: 1;
                transform: scale(1);
            }
        }

        .switching {
            animation: switchContent 0.4s ease-in-out;
        }

        /* Responsive adjustments */
        @media (max-width: 768px) {
            .container {
                padding: 15px;
                padding-top: 70px;
            }

            .top-bar {
                padding: 15px 20px;
                font-size: 13px;
            }

            .resume {
                max-width: 100%;
            }
        }

        @media (max-width: 480px) {
            .container {
                padding: 10px;
                padding-top: 60px;
            }

            .top-bar {
                padding: 12px 15px;
                font-size: 12px;
            }

            .cant-see {
                font-size: 11px;
            }
        }
    </style>
</head>

    <script>
        function updateTime() {
            const now = new Date();
            const time = new Intl.DateTimeFormat('en-GB', {
                timeZone: 'Europe/London',
                hour: '2-digit',
                minute: '2-digit',
                second: '2-digit',
                hour12: false
            }).format(now);
            
            document.getElementById('time').textContent = time;
        }

        updateTime();
        setInterval(updateTime, 1000);

        function switchToImage() {
            const resumeContainer = document.querySelector('.resume');
            const svg = resumeContainer.querySelector('svg');
            const img = resumeContainer.querySelector('img');
            
            resumeContainer.classList.add('switching');
            
            setTimeout(() => {
                svg.style.display = 'none';
                img.style.display = 'block';
                
                resumeContainer.classList.remove('switching');
            }, 200);
        }
    </script>
